import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import VIT from "../components/pages/image/VIT.svg";
import IEEE from "../assets/videos/IEEE.mp4";

function Footer() {
  useEffect(() => {
    AOS.init({ duration: 1000 });
    AOS.refresh();
  }, []);

  return (
    <div className="Foot">
      <article>
      <div class="container">

<p><a href="">
    My Projects
  </a></p>

</div>

<div id="linkBack" style="position:absolute;right:0px;top:0px;background-color:#333;margin:0;width:60px;padding:5px"><a href="https://rilling.dev/projects/" target="_blank" style="font-size:14px;text-decoration:none;color:#fff;padding:0 0 0 5px;font-family:sans-serif">My Site</a></div>
      </article>
      <br />
      <img src={VIT} className="foot-img" data-aos="slide-up" />
      <br />
      <figcaption data-aos="slide-up">
        Vishwakarma Institute of Technology
      </figcaption>
      <br />
      <br />
      <article>
        <h1>Work At</h1>
      </article>
      <br />
      <video
        data-aos="slide-up"
        src={IEEE}
        className="foot-img"
        autoPlay
        loop
        muted
        disablePictureInPicture
      />
      <br />
    </div>
  );
}

export default Footer;
